/*Table structure for table `goods_goods` */

DROP TABLE IF EXISTS `goods_goods`;

CREATE TABLE `goods_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `name` varchar(200) NOT NULL DEFAULT '' COMMENT '商品名称',
  `shop_id` int(11) DEFAULT '0' COMMENT '店铺id',
  `brief` varchar(500) DEFAULT '' COMMENT '简要描述,卖点等',
  `pic_url` varchar(250) DEFAULT '' COMMENT '商品页面商品图片',
  `share_url` varchar(1000) DEFAULT '' COMMENT '商品分享朋友圈图片',
  `status` varchar(1) DEFAULT '1' COMMENT '默认是1，表示正常状态, -1表示删除, 0下架',
  `category_id` int(11) DEFAULT '0' COMMENT '商品分类',
  `sold_num` int(11) DEFAULT '0' COMMENT '销量',
  `add_time` datetime DEFAULT NULL COMMENT '录入时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `putaway_time` datetime DEFAULT NULL COMMENT '上架时间',
  `brand_id` int(11) DEFAULT '0' COMMENT '品牌id',
  `is_new` tinyint(1) DEFAULT '0' COMMENT '是否新品',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '是否热销',
  `type_id` int(11) DEFAULT '0' COMMENT '属性类别',
  `goods_sn` varchar(20) DEFAULT '' COMMENT '商品序列号',
  `create_user_id` int(11) DEFAULT NULL,
  `update_user_id` int(11) DEFAULT NULL,
  `keywords` varchar(11) DEFAULT '',
  `gallery` varchar(334) DEFAULT NULL,
  `is_on_sale` tinyint(1) DEFAULT '1' COMMENT '是否上架',
  `sort_order` smallint(4) DEFAULT '100',
  `unit` varchar(11) DEFAULT '' COMMENT '商品单位，例如件、盒',
  `counter_price` decimal(10,2) DEFAULT '0.00' COMMENT '专柜价格',
  `retail_price` decimal(10,2) DEFAULT '0.00' COMMENT '零售价格',
  `detail` text COMMENT '商品详细介绍，是富文本格式',
  `deleted` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
