/*Table structure for table `goods_prod` */

DROP TABLE IF EXISTS `goods_prod`;

CREATE TABLE `goods_prod` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `category_id` int(11) DEFAULT NULL,
  `goods_sn` varchar(23) DEFAULT NULL,
  `goods_name` varchar(23) DEFAULT NULL,
  `brand_id` int(11) DEFAULT NULL,
  `type_id` int(11) DEFAULT NULL,
  `keywords` varchar(33) DEFAULT NULL,
  `brief` varchar(33) DEFAULT NULL,
  `goods_desc` varchar(33) DEFAULT NULL,
  `status` int(1) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `ori_price` decimal(10,2) DEFAULT NULL,
  `price` decimal(10,2) DEFAULT NULL,
  `is_new` int(1) DEFAULT NULL,
  `goods_unit` decimal(10,2) DEFAULT NULL,
  `pic` varchar(255) DEFAULT NULL,
  `img` varchar(255) DEFAULT NULL,
  `sold_num` int(11) DEFAULT '0',
  `total_stocks` int(11) DEFAULT NULL,
  `unit_price` decimal(10,2) DEFAULT NULL,
  `is_hot` int(1) DEFAULT NULL,
  `market_price` decimal(10,2) DEFAULT NULL,
  `create_user_id` int(11) DEFAULT NULL,
  `create_user_dept_id` int(11) DEFAULT NULL,
  `update_user_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

/*Data for the table `goods_prod` */

insert  into `goods_prod`(`id`,`category_id`,`goods_sn`,`goods_name`,`brand_id`,`type_id`,`keywords`,`brief`,`goods_desc`,`status`,`create_time`,`update_time`,`ori_price`,`price`,`is_new`,`goods_unit`,`pic`,`img`,`sold_num`,`total_stocks`,`unit_price`,`is_hot`,`market_price`,`create_user_id`,`create_user_dept_id`,`update_user_id`) values (1,NULL,NULL,'1',1001003,1,NULL,NULL,'<p>1</p>',0,'2021-01-23 16:52:50',NULL,'1.00','1.00',1,NULL,'1','1',1000,1,NULL,1,NULL,NULL,NULL,NULL),(5,NULL,NULL,'3',1001003,1,NULL,NULL,'<p>我</p>',1,'2021-01-24 15:30:20',NULL,'3.00','3.00',1,NULL,'3',NULL,20000,3,NULL,1,NULL,NULL,NULL,NULL);

/*Table structure for table `goods_product` */

DROP TABLE IF EXISTS `goods_product`;

CREATE TABLE `goods_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品表的商品ID',
  `specifications` varchar(33) NOT NULL COMMENT '商品规格值列表，采用JSON数组格式',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品货品价格',
  `number` int(11) NOT NULL DEFAULT '0' COMMENT '商品货品数量',
  `add_time` datetime DEFAULT NULL,
