/*Table structure for table `order_order` */

DROP TABLE IF EXISTS `order_order`;

CREATE TABLE `order_order` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `user_id` int(11) NOT NULL COMMENT '订购用户ID',
  `prod_name` varchar(1000) NOT NULL COMMENT '产品名称,多个产品将会以逗号隔开',
  `order_sn` varchar(50) NOT NULL COMMENT '订购流水号',
  `actual_total` decimal(10,2) DEFAULT NULL COMMENT '商品总费用',
  `pay_type` int(1) DEFAULT NULL COMMENT '支付方式 0 手动代付 1 微信支付 2 支付宝',
  `order_status` int(2) NOT NULL DEFAULT '0' COMMENT '订单状态 1:待付款 2:待发货 3:待收货 4:待评价 5:成功 6:失败',
  `addr_order_id` bigint(20) DEFAULT NULL COMMENT '用户订单地址Id',
  `product_nums` int(10) DEFAULT NULL COMMENT '订单商品总数',
  `pay_time` datetime DEFAULT NULL COMMENT '付款时间',
  `ship_time` datetime DEFAULT NULL COMMENT '发货时间',
  `finally_time` datetime DEFAULT NULL COMMENT '完成时间',
  `cancel_time` datetime DEFAULT NULL COMMENT '取消时间',
  `is_payed` tinyint(1) DEFAULT NULL COMMENT '是否已经支付，1：已经支付过，0：，没有支付过',
  `refund_sts` int(1) DEFAULT '0' COMMENT '0:默认,1:在处理,2:处理完成',
  `reduce_amount` decimal(15,2) DEFAULT NULL COMMENT '优惠总额',
  `order_type` tinyint(2) DEFAULT NULL COMMENT '订单类型',
  `close_type` tinyint(2) DEFAULT NULL COMMENT '订单关闭原因 1-超时未支付 2-退款关闭 4-买家取消 15-已通过货到付款交易',
  `category_id` bigint(11) DEFAULT NULL,
  `type_id` bigint(11) DEFAULT NULL,
  `pay_status` int(11) DEFAULT NULL COMMENT '支付状态',
  `shipping_status` int(11) DEFAULT NULL COMMENT '发货状态',
  `shipping_id` bigint(11) DEFAULT NULL,
  `shipping_no` varchar(11) DEFAULT NULL COMMENT '快递单号',
  `freight_price` varchar(11) DEFAULT NULL COMMENT '快递费用',
  `actual_price` decimal(10,2) DEFAULT '0.00' COMMENT '实付费用， = order_price - integral_price',
  `mobile` varchar(18) DEFAULT '' COMMENT '手机号',
  `address` varchar(18) DEFAULT '' COMMENT '收货地址',
  `integral_price` decimal(10,2) DEFAULT NULL COMMENT '用户积分减免',
  `refund_amount` decimal(10,2) DEFAULT NULL COMMENT '实际退款金额，（有可能退款金额小于实际支付金额）',
  `refund_type` varchar(16) DEFAULT NULL COMMENT '退款方式',
  `refund_content` varchar(16) DEFAULT NULL COMMENT '退款备注',
  `refund_time` datetime DEFAULT NULL COMMENT '退款时间',
  `aftersale_status` tinyint(1) DEFAULT '0' COMMENT '售后状态，0是可申请，1是用户已申请，2是管理员审核通过，3是管理员退款成功，4是管理员审核拒绝，5是用户已取消',
  `consignee` varchar(33) DEFAULT NULL COMMENT '收货人名称',
  `message` varchar(33) DEFAULT NULL COMMENT '用户订单留言',
  `coupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券减免',
  `groupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '团购优惠价减免',
  `total` decimal(10,2) DEFAULT '0.00' COMMENT '订单费用， = goods_price + freight_price - coupon_price',
  `pay_id` varchar(33) NOT NULL DEFAULT '' COMMENT '微信付款编号',
  `confirm_time` datetime DEFAULT NULL COMMENT '用户确认收货时间',
  `comments` smallint(6) DEFAULT NULL COMMENT '待评价订单商品数量',
  `end_time` datetime DEFAULT NULL COMMENT '订单关闭时间',
  `update_time` datetime DEFAULT NULL,
  `deleted` tinyint(1) DEFAULT '0',
  `create_time` datetime DEFAULT NULL,
  `status` int(5) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

